const Box = ({ title, yellow }) => {
    const backgroundColor = yellow ? 'yellow' : null;

    return (
        <div className="item">
            <div className="polaroid">
                <img src="https://image.ibb.co/b8UJBc/administration_architecture_big_ben_221166.jpg" />
                <div className="block__box caption" style={{ backgroundColor }}> {title} </div>
            </div>
        </div>
    );
}

export default Box;
